        filter(lang(?historicalPeriodLabel) = 'it')
    }
    optional { 
        <http://www.wikidata.org/entity/Q20264735> (wdt:P149) ?architecturalStyle. 
        ?architecturalStyle rdfs:label ?architecturalStyleLabel.
        filter(lang(?architecturalStyleLabel) = 'it')
    }
}

SELECT DISTINCT ?item ?itemLabel
WHERE {
  # Use the wikibase:label service to extract labels for all entities,
  # based on the local language if found, or English.
  SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }.
  {
    SELECT DISTINCT ?item (SAMPLE(?matchingType) AS ?sampleMatchingType) (MIN(?num) AS ?rank) {
      SERVICE wikibase:mwapi {
        bd:serviceParam wikibase:api "EntitySearch".
        bd:serviceParam wikibase:endpoint "www.wikidata.org".
        bd:serviceParam mwapi:search "17".
        bd:serviceParam mwapi:language "fr".
        ?item wikibase:apiOutputItem mwapi:item.
        ?num wikibase:apiOrdinal true.
      }
      # Define the set of accepted types.
      VALUES ?acceptedTypes {
        wd:Q33999 wd:Q11424 wd:Q483501 wd:Q215380 wd:Q482994
      }
      ?item wdt:P106|wdt:P31 ?type.
      # Match (any superclass of) type against accepted types.
      OPTIONAL {
        ?item wdt:P106|wdt:P31 ?matchingType.
        ?matchingType wdt:P279* ?acceptedTypes.
      }
    }
    GROUP BY ?item
    ORDER BY ?rank
    LIMIT 2
  }
  FILTER (BOUND(?sampleMatchingType) && ?rank <= 2)
}
ORDER BY ?rank
LIMIT 1

